import React,{useState, useEffect} from 'react';
import Axios from "axios";

const MapsTable = () =>  {
    const [mapList, setMapList] = useState([])

useEffect(()=>{
    Axios.get('http://localhost:3002/api/get').then((response) =>{
    setMapList(response);
    });

},[]);

  return(
    <div>
        {
            mapList.map(()=>{
                return <h1>1</h1>
            })

        }
        <h1>test</h1>
    </div>
  )
}
export default MapsTable;
